import axios from 'axios';

const Quotes = () => {

    const [quotes, setQuotes] = useState([]);

    const getQuotes = () => {
        axios.get('https://type.fit/api/quotes', {
            mode: "cors"
        })
            .then((res) => {
                setQuotes(res.data);
                console.log(res.data);

            })
            .catch((error) => {
                console.error(error);
            })

    }
    useEffect(() => {
        getQuotes()
    }, []);

