            <ul className="quotes">

                {quotes.map((quotes) => {
                    return (
                        <li key={quotes.id}>
                            <span>{quotes.author}</span>
                            <br></br>
                            <span>{quotes.text} </span>
                        </li>
                    )

                })}
            </ul>

        </div>
    )
}

export default Quotes;
